int test_results_from_shortcut_search (const char** newicks, const size_t nnewicks)
{
    theader("Test results derived from a Morphy search using the ratchet and shortcut");
    
    int failn = 0;
    
    size_t i = 0;
    
    const long ntax = Brazeau.ntax;
    const long nchar = Brazeau.nchar;
    double len = 0.0;
    const double explen = 891.0;
    
    char *rawmatrix = Brazeau.chardat;
    
    char* newick = NULL;
    
    mpl_matrix* m = mpl_matrix_new();
    mpl_matrix_set_nrows(ntax, m);
    mpl_matrix_set_ncols(nchar, m);
    mpl_matrix_attach_rawdata(rawmatrix, m);
    mpl_matrix_apply_data(m);
    mpl_init_parsimony(m);
    
    mpl_tree* t = mpl_new_tree(ntax);
    mpl_topol top;
    top.num_taxa = 1;
    top.edges = NULL;
    mpl_topol_init(ntax, &top);
    mpl_newick_rdr rdr;
    mpl_newick_rdr_init(ntax, &rdr);
    
    for (i = 0; i < nnewicks; ++i) {
        len = 0.0;
       
        newick = newicks[i];
        
        mpl_newick_read(newick, &top, &rdr);
        mpl_tree_read_topol(t, &top);
        mpl_tree_traverse(t);

        len = mpl_fullpass_parsimony(t);
        
        if (len != explen) {
            ++failn;
            pfail;
        }
        else {
            ppass;
        }
    }
    
    mpl_matrix_delete(&m);
    mpl_delete_tree(&t);
    
    return failn;
}
